	vector<float> SoftMaxLayer(vector<float> input) {
		int size = input.size();
		float sum = 0;
		vector<float> exponent(size);
		for (int i = 0; i < size; i++) {
			exponent[i] = exp(input[i]);
			sum += exponent[i];
		}
		for (int i = 0; i < size; i++) {
			input[i] = exponent[i] / sum;
		}
		return input;
	}
